import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Herosection from './components/Herosection';
import About from './components/skills';
import Project from './components/Project';
import Footer from './components/Footer';
import Nostraoverview from './components/nostraoverview';
import './App.css'
import Nostra1 from './components/nostra1';
import ProjectOverview from './components/ProjectOverview'; // Import the ProjectOverview component

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Routes>
          <Route path="/" element={<Herosection />} />
          <Route path="/about" element={<About />} />
          <Route path="/project" element={<Project />} />
          <Route path="/nostraoverview" element={<Nostraoverview />} />
          <Route path="/nostra1" element={<Nostra1 />} />
          <Route path="/project-overview" element={<ProjectOverview />} /> {/* Add route for project overview */}
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
